import React from 'react';

const Cart = (props) => {
    const cart =props.cart;
    
    

    let totalBudget = 0 ;
    for (let i = 0; i < cart.length; i++) {
        let player = cart[i];
        totalBudget += player.salary;
        
    }
    return (
        <div>
            <h1>Player : {cart.length}</h1>
            <>Total Budget = {totalBudget}</>
            
        </div>
    );
};

export default Cart;
